    document.addEventListener("DOMContentLoaded", function() {
    // Check if the current domain is cymetrixsoft.com (not drupal.cymetrixsoft.com)
    if (window.location.hostname === 'cymetrixsoft.com') {
        // Modify image and background URLs only if the domain is cymetrixsoft.com
        document.querySelectorAll('img, link[href], script[src], source[src]').forEach(function(element) {
            let url = element.src || element.href;
            
            // If the URL contains 'drupal.cymetrixsoft.com', replace 'drupal.' with an empty string
            if (url && url.includes('drupal.cymetrixsoft.com')) {
                let newUrl = url.replace('drupal.', '');
                
                // Update the element's src or href with the new URL
                if (element.src) {
                    element.src = newUrl;
                }
                if (element.href) {
                    element.href = newUrl;
                }
            }
        });
    }
});

</script>
